    Bay National Wildlife Refuge Complex outlines Refuge accomplishments during the
    1975 fiscal year. Wildlife- including migratory birds and raptors- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include commercial fishing. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes Refuge participation, hunting, and violations. Items
    of interest are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
